INSERT INTO `posts` (`id`, `category_id`, `name`, `slug`, `description`, `image`, `meta_title`, `meta_description`, `meta_keyword`, `status`, `created`) VALUES
(1, 1, 'El santo sigue siendo el m谩ximo referente de la Lucha Libre Mexicana', 'muerte-del-santo', '<p>\r\n\r\n\r\n	\r\n	\r\n	\r\n	\r\n\r\n</p><p style=\"line-height: 108%; margin-bottom: 0.28cm\">\r\n<img style=\"width: 800px;\" src=\"data:image/png;base64,\" data-filename=\"imagen.png\"><span lang=\"es-ES\"><br></span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Este\r\ns谩bado 5 de febrero se cumpli贸 un a帽o m谩s de la partida de\r\nRodolfo Guzm谩n Huerta, quien como el Enmascarado de Plata logr贸\r\ntrascender a nivel mundial.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">A\r\n38 a帽os de su muerte, El Santo sigue siendo el m谩ximo referente de\r\nla Lucha libre en M茅xico.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">A\r\npesar de que han existido grandes figuras dentro de la lucha libre en\r\nM茅xico, hay uno que se convirti贸 en el m谩ximo referente a nivel\r\nmundial, se trata del emblem谩tico El Santo, el m谩ximo 铆dolo de los\r\nmexicanos, quien este 5 de febrero, pero del a帽o 1984, a la edad de\r\n66 a帽os, parti贸 de este mundo para formar parte del firmamento\r\nluch铆stico.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Fue\r\nas铆 que Rodolfo Guzm谩n Huerta, quien naci贸 en Tulancingo, Hidalgo\r\nen 1917, dejar铆a un legado imborrable dentro de los cuadril谩teros y\r\nel cine; pues logr贸 protagonizar tanto como estrella principal y en\r\nmancuerna con el tambi茅n legendario Blue Demon, varias pel铆culas\r\nllenas de acci贸n en donde enfrentaba a terribles monstruos o\r\nsupervillanos.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">A\r\npesar de que este s谩bado 5 de febrero de 2022 se cumplieron 38 a帽os\r\nde su partida, el emblem谩tico Enmascarado de Plata sigue\r\nestando presente en cada uno de los corazones de sus miles de\r\nfan谩ticos que lo vieron brillar en sus mejores a帽os, pues gracias a\r\nsu hijo El Santo Jr., las nuevas generaciones han podido conocer la\r\nhistoria de la gran leyenda de la lucha libre mexicana.</span></p>\r\n\r\n<p><style type=\"text/css\">p { line-height: 115%; text-align: left; orphans: 2; widows: 2; margin-bottom: 0.25cm; direction: ltr; background: transparent }</style></p>', , 'A 38 AOS DE SU MUERTE, EL SANTO SIGUE SIENDO EL MXIMO REFERENTE DE LA LUCHA LIBRE EN MXICO', 'A 38 a帽os de su muerte, El Santo sigue siendo el m谩ximo referente de la Lucha libre en M茅xico.', 'Muerte, El santo.,Tulancingo', 0, '2023-08-17 15:30:23');
INSERT INTO `posts` (`id`, `category_id`, `name`, `slug`, `description`, `image`, `meta_title`, `meta_description`, `meta_keyword`, `status`, `created`) VALUES
(2, 2, 'As铆 fueron las 煤ltimas horas del enmascarado de plata', 'enmascarado-de-plata', '<p><img style=\"width: 800px;\" src=\"data:image/png;base64,\" data-filename=\"imagen.png\"></p><p>\r\n\r\n\r\n	\r\n	\r\n	\r\n	\r\n\r\n</p><p style=\"line-height: 108%; margin-bottom: 0.28cm\">\r\n<span lang=\"es-ES\">El Santo sigue siendo recordado por todos los\r\nfan谩ticos de la lucha libre mexicana.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">驴De\r\nqu茅 muri贸 el Santo? As铆 fueron las 煤ltimas horas del enmascarado\r\nde plata.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Dentro\r\nde la majestuosa historia luch铆stica en M茅xico, El Santo es sin\r\nduda el m谩ximo referente de los encordados y uno de los 铆dolos que\r\nsigue latente a pesar de que las nuevas generaciones no crecieron\r\nviendo sus innumerables movimientos arriba del cuadril谩tero, pues,\r\nhoy en d铆a, la lucha libre ya es muy diferente a lo que se ve铆a\r\nhace m谩s de 50 a帽os.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Originario\r\nde la bella ciudad de Tulancingo, Hidalgo, Rodolfo Guzm谩n Huerta o\r\nmejor conocido como El Santo es considerado el mejor luchador de\r\ntodos los tiempos, ya que su gran popularidad lo llev贸 incluso a la\r\npantalla grande donde inmortaliz贸 varias pel铆culas a lado de la\r\nleyenda Blue Demon.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">El\r\nSanto perdi贸 la vida a causa de un infarto y al d铆a siguiente de su\r\ndeceso sus restos fueron llevados a los Mausoleos del ngel donde\r\ndescansan y son visitados por cientos de fan谩ticos que lo recuerdan\r\ncon mucho cari帽o y enaltecen a la m谩xima leyenda de la lucha libre\r\nen M茅xico.</span></p>\r\n\r\n<p><style type=\"text/css\">p { line-height: 115%; text-align: left; orphans: 2; widows: 2; margin-bottom: 0.25cm; direction: ltr; background: transparent }</style></p>', , 'As铆 fueron las 煤ltimas horas del enmascarado de plata', 'El Santo sigue siendo recordado por todos los fan谩ticos de la lucha libre mexicana.', 'Enmascarado de Plata', 0, '2023-08-17 15:33:41');
INSERT INTO `posts` (`id`, `category_id`, `name`, `slug`, `description`, `image`, `meta_title`, `meta_description`, `meta_keyword`, `status`, `created`) VALUES
(3, 2, 'El Santo: As铆 fue cuando mostr贸 su ROSTRO ante las c谩maras de televisi贸n ', 'cuando-mostrar-su-rostro', '<p><img style=\"width: 50%;\" src=\"data:image/png;base64,\" data-filename=\"imagen.png\"></p><p>\r\n\r\n\r\n	\r\n	\r\n	\r\n	\r\n\r\n</p><p style=\"line-height: 108%; margin-bottom: 0.28cm\">\r\n<span lang=\"es-ES\">En un par de ocasiones, el Santo amag贸 con\r\nquitarse la m谩scara durante la d茅cada de los ochenta, justo cuando\r\nsu carrera dentro de la lucha libre comenzaba su desenlace</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Son\r\ncontados los luchadores que han pasado a la historia por sus\r\ncapacidades as铆 como su identidad. Uno de ellos fue el Santo, icono\r\ndel pancracio nacional y que logr贸 traspasar las fronteras. A pesar\r\nde su exposici贸n medi谩tica, el deportista fue muy cuidadoso de no\r\nmostrar su rostro. Pero en alguna ocasi贸n realiz贸 lo impensado.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">En\r\nun par de ocasiones, el Santo amag贸 con quitarse la m谩scara durante\r\nla d茅cada de los ochenta. Justo cuando su carrera dentro de la lucha\r\nlibre comenzaba su desenlace. El luchador se present贸 en el programa\r\n\'Hoy mismo\', que era conducido por Guillermo Ochoa, en donde se quito\r\ny puso la m谩scara de manera muy r谩pida.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Revela\r\nsu identidad</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Fue\r\nen 1984, cuando Rodolfo Guzm谩n, nombre real del luchador, acudi贸 al\r\nprograma \'Contrapunto\', con Jacobo Zabludovsky, donde volvi贸 a\r\ndescubrir sus rostro de manera r谩pida, pero el momento cobr贸\r\nrelevancia cuando el periodista retransmiti贸 la imagen durante el\r\nnoticiero 24 Horas en donde se congel贸 la imagen y se pudo conocer\r\nel rostro del legendario Santo.</span></p>\r\n<p style=\"line-height: 108%; margin-bottom: 0.28cm\"><span lang=\"es-ES\">Su\r\nparticipaci贸n en \'Contrapunto\' ocurri贸 el 26 de enero de 1984. Diez\r\nd铆as despu茅s, el m铆tico luchador perdi贸 la vida. El domingo 5 de\r\nfebrero despu茅s de terminar un n煤mero de escapismo en el Teatro\r\nBlanquita le ocurri贸 un infarto al miocardio a las siete de la\r\nnoche. De inmediato fue llevado al Hospital Mocel. La segunda funci贸n\r\nde la noche no cont贸 con el luchador.</span></p>\r\n<p lang=\"es-ES\" style=\"line-height: 108%; margin-bottom: 0.28cm\"><br>\r\n<br>\r\n\r\n</p>\r\n\r\n<p><style type=\"text/css\">p { line-height: 115%; text-align: left; orphans: 2; widows: 2; margin-bottom: 0.25cm; direction: ltr; background: transparent }</style></p>', , 'El Santo: As铆 fue cuando mostr贸 su ROSTRO ante las c谩maras de televisi贸n ', 'En un par de ocasiones, el Santo amag贸 con quitarse la m谩scara durante la d茅cada de los ochenta, justo cuando su carrera dentro de la lucha libre comenzaba su desenlace', 'Sin mascara', 0, '2023-08-17 15:35:44');
